import AsyncStorage from "@react-native-async-storage/async-storage";

const USERS_INFO = "@userInfo";

export class NavigationService {
  navigateMenu = ({ navigation }, params) => {
    navigation.navigate("Menu", { info: params });
  };
  navigateProductsForm = ({ navigation }, params) => {
    navigation.navigate("ProductsForm", { info: params });
  };
  navigateProductsList = ({ navigation }, params) => {
    navigation.navigate("ProductsList", { info: params });
  };
  navigateSaleForm = ({ navigation }, params) => {
    navigation.navigate("SaleForm", { info: params });
  };
  navigateSaleList = ({ navigation }, params) => {
    navigation.navigate("SaleList", { info: params });
  };
  navigateSignin = ({ navigation }, params) => {
    navigation.navigate("Signin", { info: params });
  };
  navigateSignup = ({ navigation }, params) => {
    navigation.navigate("Signup", { info: params });
  };
  navigateUsersList = ({ navigation }, params) => {
    navigation.navigate("UsersList", { info: params });
  };
  logout = async ({ navigation }, params) => {
    await AsyncStorage.removeItem(USERS_INFO);
    navigation.navigate("Signin", { info: params });
  };
}
